INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (401, 24, "アヤネ", 0.0, 24001, "2030/12/17 14:59:59", 2, 0.0, 10046, "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", 0.0, 102301, 2, "2020/07/31 12:00:00");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (402, 24, "アヤネ", 0.0, 24002, "2030/12/17 14:59:59", 2, 0.0, 10046, "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", 2.21, 102301, 1, "2020/07/31 12:00:00");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (403, 24, "アヤネ", 0.0, 24003, "2030/12/17 14:59:59", 2, 0.0, 10046, "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", 0.0, 102301, 2, "2020/07/31 12:00:00");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (701, 24, "アサヒ", 0.0, 24004, "2030/12/17 14:59:59", 1, 0.0, 10046, "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", 1.99, 192201, 2, "2020/07/31 12:00:00");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (702, 24, "アサヒ", 0.0, 24005, "2030/12/17 14:59:59", 2, 0.0, 10046, "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", 2.21, 192201, 1, "2020/07/31 12:00:00");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (703, 24, "アサヒ", 0.0, 24006, "2030/12/17 14:59:59", 1, 0.0, 10046, "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", 3.33, 192201, 2, "2020/07/31 12:00:00");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (801, 24, "部員３", 0.0, 24007, "2030/12/17 14:59:59", 2, 0.0, 10046, "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", 0.0, 192301, 2, "2020/07/31 12:00:00");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (802, 24, "部員３", 0.0, 24008, "2030/12/17 14:59:59", 2, 0.0, 10046, "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", 2.68, 192301, 1, "2020/07/31 12:00:00");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (803, 24, "部員３", 0.0, 24009, "2030/12/17 14:59:59", 2, 0.0, 10046, "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", 0.0, 192301, 2, "2020/07/31 12:00:00");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (501, 24, "", 0.0, 24010, "2030/12/17 14:59:59", 1, 0.0, 10046, "やった！", 0.0, 192501, 1, "2020/07/31 12:00:00");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (502, 24, "", 0.0, 24011, "2030/12/17 14:59:59", 1, 0.0, 10046, "勝ったよ！", 0.0, 192501, 1, "2020/07/31 12:00:00");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (503, 24, "", 0.0, 24012, "2030/12/17 14:59:59", 1, 0.0, 10046, "いい調子！", 0.0, 192501, 1, "2020/07/31 12:00:00");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (111, 24, "ミサト", 0.0, 24013, "2030/12/17 14:59:59", 2, 0.0, 10046, "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", 5.33, 113501, 6, "2020/07/31 12:00:00");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (112, 24, "ミサト", 0.0, 24014, "2030/12/17 14:59:59", 2, 0.0, 10046, "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", 6.85, 113501, 1, "2020/07/31 12:00:00");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (113, 24, "ミサト", 0.0, 24015, "2030/12/17 14:59:59", 2, 0.0, 10046, "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", 3.0, 113501, 1, "2020/07/31 12:00:00");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (611, 24, "ダイチ", 0.0, 24016, "2030/12/17 14:59:59", 2, 0.0, 10046, "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", 6.11, 192401, 1, "2020/07/31 12:00:00");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (612, 24, "ダイチ", 0.0, 24017, "2030/12/17 14:59:59", 2, 0.0, 10046, "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", 6.75, 192401, 1, "2020/07/31 12:00:00");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (613, 24, "ダイチ", 0.0, 24018, "2030/12/17 14:59:59", 2, 0.0, 10046, "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", 0.0, 192401, 2, "2020/07/31 12:00:00");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (211, 24, "ハツネ", 0.0, 24019, "2030/12/17 14:59:59", 1, 0.0, 10046, "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", 4.52, 113401, 2, "2020/07/31 12:00:00");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (212, 24, "ハツネ", 0.0, 24020, "2030/12/17 14:59:59", 1, 0.0, 10046, "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", 3.89, 113401, 2, "2020/07/31 12:00:00");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (213, 24, "ハツネ", 0.0, 24021, "2030/12/17 14:59:59", 2, 0.0, 10046, "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", 13.49, 113401, 1, "2020/07/31 12:00:00");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (311, 24, "カヤ", 0.0, 24022, "2030/12/17 14:59:59", 2, 0.0, 10046, "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", 3.17, 106501, 1, "2020/07/31 12:00:00");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (312, 24, "カヤ", 0.0, 24023, "2030/12/17 14:59:59", 2, 0.0, 10046, "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", 4.42, 106501, 1, "2020/07/31 12:00:00");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (313, 24, "カヤ", 0.0, 24024, "2030/12/17 14:59:59", 1, 0.0, 10046, "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", 2.89, 106501, 6, "2020/07/31 12:00:00");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (421, 24, "アヤネ", 0.0, 24025, "2030/12/17 14:59:59", 3, 0.0, 10046, "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", 3.71, 102301, 4, "2020/07/31 12:00:00");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (721, 24, "アサヒ", 0.0, 24026, "2030/12/17 14:59:59", 1, 0.0, 10046, "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", 5.1, 192201, 2, "2020/07/31 12:00:00");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (821, 24, "部員３", 0.0, 24027, "2030/12/17 14:59:59", 3, 0.0, 10046, "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", 4.34, 192301, 1, "2020/07/31 12:00:00");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (521, 24, "", 0.0, 24028, "2030/12/17 14:59:59", 1, 0.0, 10046, "いい勝負だったよ\nまたやろうね", 0.0, 192501, 1, "2020/07/31 12:00:00");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (101, 24, "ミサト", 0.0, 24029, "2030/12/17 14:59:59", 2, -360.0, 10046, "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", 5.62, 113501, 1, "2020/07/31 12:00:00");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (102, 24, "ミサト", 0.0, 24030, "2030/12/17 14:59:59", 2, -360.0, 10046, "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", 9.58, 113501, 1, "2020/07/31 12:00:00");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (103, 24, "ミサト", 0.0, 24031, "2030/12/17 14:59:59", 2, -360.0, 10046, "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", 0.0, 113501, 2, "2020/07/31 12:00:00");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (104, 24, "ミサト", 0.0, 24032, "2030/12/17 14:59:59", 1, -360.0, 10046, "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", 9.13, 113501, 2, "2020/07/31 12:00:00");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (105, 24, "ミサト", 0.0, 24033, "2030/12/17 14:59:59", 2, -360.0, 10046, "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", 8.27, 113501, 1, "2020/07/31 12:00:00");
